import { Button } from "@mui/material";
import { useEffect } from "react";
import { useNavigate } from "react-router-dom";

const Result = ({name,score}) => {
const navigate = useNavigate()
    useEffect(() => {
        if(!name){
            navigate('/')
        }
    },[name,navigate])

    return(
        <>
       <div>
           <span>Final Score : {score}</span>

           <Button

           >
               Go to HomePage
           </Button>
       </div>
        </>
    )
}

export default Result;
